As I'm preparing for the final InkBox release this year ( and the next year propably, hopefully not ever? ) I would like to collect some feedback from users, especially reasons why you stopped using InkBox, but other opinions on improvements are also welcome. If you use it you could also reply in some way ( we have no way of tracking how many users we have🥴  )
You can write them to me via private chat or on the #quill channel

@everyone 
Which device in the current Kobo lineup would you like to see ported to InkBox the most? We have got some money from donations but don't know what model to choose.
Thanks

@everyone 
InkBox OS has now been officially renamed to Quill OS
Thank you for your input and we hope to offer you a better, renewed experience soon
